import React from 'react';
import { Link } from "react-router-dom";


export default function Prueba (){
    const pokemons = 0; 

    return(
        <div>
            {pokemons?
            <h4>   
                Existen pokemons
            </h4>:
            <h4>   
                NO existen pokemons
            </h4>
            }
        </div>
    )
}
